import React from "react";
import "../styles/clients.css";
import Client1 from "../resource/client1.jpg";
import Client2 from "../resource/client2.jpg";
import Client3 from "../resource/client3.jpg";
import Client4 from "../resource/client4.jpg";
import {clientsContentData} from "../actions/clientsAC";
import {connect} from "react-redux";
import Twitter from "../resource/twitter.svg";
import GooglePlus from "../resource/gPlus.svg";
import Facebook from "../resource/fcb.svg";

class Clients extends React.Component{
    componentDidMount() {
        this.props.fetchData("http://localhost/backend/clients.php");
    }
    render(){
        // let OurClients = this.props.clients.map((data, index) => {
        //     return (
        //         <div  key={index} ><img src={data.img} alt="Clients"/></div>
        //
        //     )
        // })
    return (
        <div className="clientsContent" id="clients">
            <h1>{this.props.title.clientsTitle?this.props.title.clientsTitle['title']:""}</h1>
            <div className="clientsContext">
                <hr/>
                <h6>{this.props.title.clientsTitle?this.props.title.clientsTitle['context']:""}</h6>
                <hr/>
            </div>
            <div className="clients">
                <img src={Client1} alt="Clients"/>
                <img src={Client2} alt="Clients"/>
                <img src={Client3} alt="Clients"/>
                <img src={Client4} alt="Clients"/>
                <img src={Client1} alt="Clients"/>
                <img src={Client2} alt="Clients"/>
                <img src={Client3} alt="Clients"/>
                <img src={Client4} alt="Clients"/>
            </div>
        </div>
    )}
}

const mapStateToProps = state => ({
    clients: state.clients,
    title: state.header
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(clientsContentData(url))
});
export default connect(mapStateToProps, mapDispatchToProps)(Clients)
